import axios from "axios";
import React from "react";
import { Button } from "@mui/material";
import PokeImage from "./PokeImage";
import PokeDetails from "./PokeDetails";

const baseURL = "https://pokeapi.co/api/v2/pokemon/?offset=0&limit=905";


function List() {

  function SwitchPages() {
    return <PokeDetails/> 
  }

  function returnthis() {
    const as = "https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/other/official-artwork/150.png"
  }

   const [post, setPost] = React.useState(null);

  React.useEffect(() => {
    axios.get(baseURL).then((response) => {
      setPost(response.data.results);
    });
  }, []);

  if (!post) return null;

  return (
    <div>
       {post.map((item) => (
        <Button onClick={SwitchPages}> 
          <img src={returnthis.as} ></img>
          {item.name} 
        </Button>
        ))}
    </div>
  );
}

export default List
